import './header.css';
import{ Segment } from 'semantic-ui-react';
export default function Header() {
  return(
      
   <header data-v-85f12452="" class="v-sheet theme--light v-toolbar v-app-bar v-app-bar--fixed" data-booted="true" style="min-height: 58px; height: 64px; margin-top: 0px; transform: translateY(0px); left: 56px; right: 0px; background-color: rgb(222, 222, 222); border-color: rgb(222, 222, 222);">
       <h2 style={{"text-align": "center"}}>
  
        <div class="v-toolbar__content" style={{"height": "64px"}}>
            <img src="../../images/icon-fs-orange.svg" height="50px" class="mr-5"/>
      <div class="v-toolbar__title" style={{"color": "rgb(79, 79, 79)"}}><b >FARM</b>SIMPLE Console</div>
      <div class="spacer"></div><span id="userDetails">Align Agith </span> | <span id="userDetails" style={{"color": "rgb(244, 67, 54)"}}> Owner</span>
      <button type="button" class="white--text v-btn v-btn--is-elevated v-btn--has-bg theme--light v-size--default deep-orange darken-2"><span class="v-btn__content">Logout </span></button>
      </div>
      </h2>
    </header>
      
      );
}
